import { Navigate, useLocation, Route } from 'react-router-dom';
import Blad404 from '../404';

function PrivateRoute({ children, user, role, ...rest }) {
  const location = useLocation();
  
  return (
    <Route
      {...rest}
      element={
        role === 'admin'
          ? children
          : <Navigate to={Blad404} state={{ from: location }} /> 
      }
    />
  );
}

export default PrivateRoute;
